export { VERSES };

class Vocab {
  constructor(term, morph, lexical_entry, meaning) {
    this.term = term;
    this.morph = morph;
    this.lexical_entry = lexical_entry;
    this.meaning = meaning;
  }

  dom() {
    let ret = "";
    if (this.morph != null) {
      ret += "<span class=\"greek\">" + this.term + "</span>: " + this.morph + " of ";
    }
    ret += "<span class=\"greek\">" + this.lexical_entry + "</span>";
    if (this.meaning != null) {
      ret += ": " + this.meaning;
    }
    return ret;
  }
}

class Verse {
  constructor(ref, lesson, words, extra) {
    this.ref = ref;  // The unique reference for this verse.
    this.lesson = lesson;  // The lesson number you should learn up to for this verse.
    this.words = words;  // The list of words in this verse.
    this.extra = extra;  // The list of unknown words where a translation is needed.
    this.text = words.map(x => x[0]).join(' ');
  }
}

